import React from "react"; 
const Home = () => {
    return (
    <React.Fragment>
    <h1>Home Page</h1>
    <div className="iphone-pro">
      <div className="overlap-group-wrapper">
        <div className="overlap-group">
          <div className="text-wrapper">Personality</div>
          <img className="BG" alt="Bg" src="BG-21.png" />
          <div className="rectangle" />
          <div className="div" />
          <div className="next">Next &lt;3</div>
          <img className="polygon" alt="Polygon" src="polygon-1.svg" />
        </div>
      </div>
    </div>
    </React.Fragment>
    )
};
export default Home;
